import Footer from "components/basics/footer";
import NavBar from "components/basics/navbar";

export default function App() {
  return (
    <>
      <NavBar />
      <div className="App">
        <h1>Comunidade de Codigo e Programacao - Projeto inicial Front-End</h1>
      </div>
      <Footer />
    </>
  );
}
